import React from "react";
import './About.css'

function About() {
  return (
    <div className="about-container">
      <div className="about-content">
        <h1>About Us</h1>
        <h2>Description:</h2>

<p>Welcome to Bootstrap Rentals, your trusted partner in finding the perfect rental property. With years of experience in the real estate industry, we have established ourselves as a leading property rental service provider in Chennai. Our mission is to provide a seamless and hassle-free rental experience to our clients, ensuring that they find their dream home with ease.</p>

<h2>Our Story:</h2>

<p><h4>Our journey began with a simple goal:</h4> To make property rental easier, faster, and more convenient. We saw an opportunity to bridge the gap between property owners and renters, and to provide a platform that would simplify the rental process for both parties. Today, we are proud to have a diverse portfolio of properties for rent, ranging from cozy apartments to spacious houses, and a team of experts who are dedicated to delivering exceptional customer service.
        </p>
      </div>
    </div>
  );
}

export default About;
